INSERT INTO `bulletinboard` VALUES (1,'(JM) Please take a look at the word document titled \"J-Box Procedures\" in the IT folder in our Dropbox folder.  It is a list of common procedures and scenarios that IT employees will encounter in the future.  If you have any suggestions or comments please let me know.\r\n(MW) Put a password encrypted word document which contains need-to-know IT info.','zburditt'),(2,'<p style=\"text-align:center\"><strong>ANNOUNCEMENTS:</strong></p>\r\n\r\n<p>**Laura Valentin is added to the list of tutors**</p>\r\n\r\n<p>**Tiffany Leuthner added as LLLRC employee to J-Box**</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>1. First thing in the morning please bring either astro 1 or 2 to room 112 until the new receiver is installed</p>\r\n\r\n<p>2. A list of common IT procedures is posted at the front desk in the black tray in the center. If you need to repair a problem in the classroom the most common</p>\r\n\r\n<p>&nbsp; &nbsp; procedures are listed there.</p>\r\n\r\n<p>3. The new procedures for the Astros is in the tray, these are tasks to be done daily after 3pm by the Front Desk Employees</p>\r\n\r\n<p>4. Please make sure not to throw away the Tutoring sign-up sheets for the summer dv</p>\r\n\r\n<p>5. The order for the test folders goes New Spanish Tests, Completed Spanish Tests, New Other Language Tests, and Completed Other Language tests. Please make sure that the folders stay in this order, with the labels facing outwards.&nbsp;</p>\r\n\r\n<p>6. All of the Spring proctor forms have been moved to a seperate folder at the back of the test drawer. The Summer proctor forms are still located in the &#39;Completed Proctor Forms&#39; folder.&nbsp;</p>\r\n','thinson');
/*!40000 ALTER TABLE `bulletinboard` ENABLE KEYS */;
